// App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import TaskProvider from "../context/TaskProvider"; // Adjust this path as needed
import Lists from "./Lists";

function App() {
  return (
    <TaskProvider>
      <Router>
        <Routes>
          <Route path="/" />
          <Route path="/lists" element={<Lists />} />
        </Routes>
      </Router>
    </TaskProvider>
  );
}

export default App;
